import 'package:flutter/material.dart';
void main(){
  runApp(MaterialApp(  debugShowCheckedModeBanner: false,home:Seraching() ));
}
class Seraching extends StatefulWidget {
  const Seraching({Key? key}) : super(key: key);

  @override
  State<Seraching> createState() => _SerachingState();
}

class _SerachingState extends State<Seraching> {
  TextEditingController _controller=TextEditingController();
  List<Listes> lists=totalListes;
  void searchList(String query){
    final suggestions=totalListes.where((list) {
final listTitle=list.title.toLowerCase();
final input=query.toLowerCase();
return listTitle.contains(input);
    }).toList();
    setState(() {
      lists=suggestions;
    });
  }
  @override
  Widget build(BuildContext context) {
    return Scaffold(

      body: Column(children: [

        Container(margin: EdgeInsets.all(16),child: TextField(
          onChanged: searchList,
          controller: _controller,
decoration: InputDecoration(prefixIcon: Icon(Icons.search),hintText: 'Search',
  border: OutlineInputBorder(borderRadius: BorderRadius.circular(20),borderSide: BorderSide(color: Colors.blue))

),
        ),),
        Expanded(child: ListView.builder(itemCount:lists.length ,itemBuilder: (context,index){
final list=lists[index];
          return  Padding(
            padding:  EdgeInsets.only(top: 20,bottom: 20),
            child: ListTile(leading: Container(height:40,width: 50,child: Image.network(list.urlImage)),
            title: Text(list.title),),
          );

        }))
      ],),
    );
  }

}

